import{projetosData as e}from"./data.js";function createProjectTemplate(e){return`
        <article class="project-card">
            <h3>${e.titulo}</h3>
            <p>${e.descricao}</p>
            <img src="${e.imagem}" alt="${e.alt}">
        </article>
    `}function loadProjects(){let t=document.getElementById("projetos-dinamicos");if(!t)return;let r=e.map(e=>createProjectTemplate(e)).join("");t.innerHTML=r}export{loadProjects};